    __webpack_exports__["default"] = "<div class=\"page-container\">\n    <h1 class=\"text-center title\">ABOUT US</h1>\n    <img class=\"bg\" src=\"./assets/images/3.jpeg\">\n\n</div>\n\n<p class=\"page-content\">\n\n    GalaxyEuro was set up in the UAE by Mr Srinath Naidu in the beginning\n    of 2014 to be a SPV for the Italian government QC organization IMQ to\n    enter the Middle East and Indian markets. IMQ is a global leader in TIC\n    operations and is the world leader in Automobile Testing and\n    Certification with most top brands (Lamborgini, Rolls Royce, Mercedes,\n    Ferrari, Toyota, Honda) in their kitty.\n\n    <br><br>\n    The joint venture activity for IMQ to enter the UAE as a collaborator\n    with ESMA was the primary step and was successfully completed in\n    2014 and a new company rolled out in UAE under the name of\n    GalaxyEuro and later renamed as Gulf-TIC.\n\n    <br><br>\n\n    Then GalaxyEuro under mandate from Gulf-TIC and IMQ started\n    creating a similar activity in India collaborating Govt of India with IMQ\n    and a top Indian business conglomerate to create a Testing and\n    Certification agency in India with a global outlook. On successful\n    creation of the activity, GalaxyEuro started work on a broad-based\n    spectrum with emphasis on niche business activities in India.\n    Meanwhile in South Africa, a project was also undertaken to create a\n    Automotive Safety and Tolling process for the RTA as done in the UAE.\n    The project was undertaken to automate the South African road\n    system. After the successful completion of this process for the UAE and\n    the East African area, the re-engineered Indian operation was set up\n    and started work with top business names in India under the flag of\n    the Indian collaborator.\n\n    <br><br>\n\n    The new reengineered buyin gives GalaxyEuro the strength in the\n    market across a basket of unique offerings along with the bandwidth\n    across the geo footprint we cover and monitor. GalaxyEuro stands fully\n    energized to deliver our unique strategic offers to businesses who\n    need our partnership and support. GalaxyEuro is based out of India -\n    the fastest growth market in the world and growth is oriented into\n    India and Out Of India towards Europe and American markets. China\n    and Australia – work is in progress to create a two way business traffic\n    with solid bases.\n    <br><br>\n    Team GalaxyEuro are absolutely Experienced hands on (thus we\n    actually understand your need from a practical reality front rather than\n    just a billing front), Team GalaxyEuro are Lean and Mean (due to our\n    business process - we operate as nano strategic teams, rather than\n    holistic large teams - so you get the right portions you need - e.g: success\n    story of 1+), Team GalaxyEuro are Energised (we have taken years to\n    build the networks in the Corporate word, in the Beauraucracy, with the\n    organized workers base too - you get the advantage of hitting the road\n    running).\n\n    <br><br>\n\n    GalaxyEuro has as ASSOCIATES, a number of qualified, professional\n    and skilled persons in the various specialised areas of the operations.\n    The organisation operates in a classical hub and spoke business\n    process with a unique tech twist to enable activities be handled by\n    specialised persons with hard core and in depth expertise and only the\n    hub unit interfaces with clients and manages the sub hub units thru\n    the spoke lifeline system, bringing in the expertise to make each sub\n    hub into a full fledged business strategy enterprise to give the specific\n    client a tailor made process and implement the same if required.\n    GalaxyEuro is reengineered to encompass a number of sub activities –\n    each as a standalone with its own specilised teams to enable the best\n    returns to clientele. We have completed discussion to set up\n    representative offices in the United States of America, Germany,\n    Kenya, Italy. Dubai, Mauritius, Ghana and China are in progress to\n    ensure that any and all clients have full and complete accessibility to\n    our services in India - both InBound and OutBound.\n    After almost a few years of research across the entire Indian business\n    and beauraucracy spectrum, the team zeroed in on specific activities\n    that can be undertaken against specific requirements. With the ever\n    changing business environs plus the need for quality, speed and ethical\n    business the chosen area will be a one stop business assistance\n    organization for:\n\n    <br><br>\n\n    A brief synopsis on the activities considered are:\n\n\n</p>\n\n<div class=\"row m-0 activities-container\">\n    <div class=\"col-md-6 col-sm-12 col-xs-12 activities\">\n        <p>Dharmaadikaritva Div - EZ’s, Customs and GST</p>\n    </div>\n    <div class=\"col-md-6 col-sm-12 col-xs-12 activities\">\n        <p>Manava Div - IR & HR Activity</p>\n    </div>\n    <div class=\"col-md-6 col-sm-12 col-xs-12 activities\">\n        <p>Uttaraditva Div - CSR</p>\n    </div>\n    <br>\n    <div class=\"col-md-6 col-sm-12 col-xs-12 activities\">\n        <p>Janapada Seva Div - Civil Services Magazine</p>\n    </div>\n    <br>\n    <div class=\"col-12 activities\">\n        <p>Antarastriya Div - India entry assistance, Market to go and\n            OutBound</p>\n    </div>\n</div>\n\n<div class=\"map-container align-content-center row m-0\" (click)=\"openAddress()\" >\n    <img class=\"img-fuild logo\" src=\"./assets/images/map.png\">\n\n    <div class=\"col-md-4  offset-md-8\">\n        <div class=\"address-container \">\n            <br>\n            <img class=\" img-fluid\" src=\"./assets/images/header-logo.png\">\n            <br>\n            <p>\n                Villa 32, Oorjitha Grand Vie 2, Gundlapochampally Road,\n                Kompally, Hyderabad, Telengana, India - 500014\n            </p>\n        </div>\n\n    </div>\n\n</div>\n";
